import React, { useState } from "react";
import "./index.css";



const App = ()=>{

    let date = new Date();
    // let getTime = date.toLocaleTimeString();

    const [getTime,setTime] = useState(new Date().toLocaleTimeString());

    const getCurrentTime = ()=>{
        return setTime(new Date().toLocaleTimeString());
    }

    return(
        <>
            <div>
                <h1>{getTime}</h1>
                <button onClick={getCurrentTime}>Get TIme</button>
                
            </div>
        </>
    )
};

export default App;
